// src/App.js


import React from 'react';
import './App.css';
import RuleForm from './components/RuleForm';
import RuleEvaluator from './components/RuleEvaluator';


function App() {
  return (
    <div className="App">
      <h1>Rule Engine</h1>
      <RuleForm />
      <RuleEvaluator />
    </div>
  );
}


export default App;
